import React from 'react';
import Cookie from 'universal-cookie';

export default class Dashboard extends React.Component{

    render(){
        var cookie = new Cookie();
        var username = cookie.get('username');
        return(
            <div>Dashboard utente:{username}</div>
        )
    }
}
